import React from 'react'
import Navbar from "../components/Navbar"
import ItemList from '../components/ItemList.jsx'

export const Home = () => {
  return (
    <div>
      <Navbar></Navbar>
      <hr color="gray" width="75%"/>
      <hr color="gray" width="50%"/>
      <hr color="gray" width="25%"/>

      <br></br>
      <ItemList></ItemList>
    </div>
  );
};

export default Home;
